function About() {
    return(
        <div>
            <h2>Somos</h2>
            <p>Una empresa dedicada a proporcionar soluciones tecnológicas con el objetivo de elevar la calidad del software en Latinoamérica</p>
            <h2>¿Que hacemos?</h2>
            <p>Desarrollamos software de calidad con las mejores tecnologías para nuestros clientes aumenten su productividad.</p>
        </div>
    )

}

export default About;
